const cryptocurrencies = require('cryptocurrencies');
export function getStocks() {
  let listInArrayForm= Object.keys(cryptocurrencies).map(x=> [{abbr:x, name:cryptocurrencies[x]}])
  console.log(listInArrayForm)
}
